(1, 'Math Calculas Course', 'There are a number of reasons you may need a block of text and when you do, a random paragraph can be the perfect solution. If you happen to be a web designer and you need some random text to show in your layout, a random paragraph can be an excellent way to do this. If you\'re a programmer and you need random text to test the program, using these paragraphs can be the perfect way to do this. Anyone who\'s in search of realistic text for a project can use one or more of these random paragraphs to fill their need.', 'courses/1692267142_math_calculas_course/thumb_1692267142.png', 100, 'tag1,tag2,tag3', 'Math Course', 'P. Jhon Wick', 0, '1692267142_math_calculas_course', NULL, '2023-08-17 07:12:22', '2023-08-17 07:12:22');
